The widgets macro will take care of creating the widgets struct and will also implement the Widgets trait for us. All other parts of the code remain untouched so we can reuse most of the code from our first app. Let's have a look at the macro and go through the code step by step: #[relm4_macros::widget]
impl Widgets<AppModel, ()> for AppWidgets { view! { gtk::ApplicationWindow { set_title: Some("Simple app"), set_default_width: 300, set_default_height: 100, set_child = Some(&gtk::Box) { set_orientation: gtk::Orientation::Vertical, set_margin_all: 5, set_spacing: 5, append = &gtk::Button { set_label: "Increment", connect_clicked(sender) => move |_| { send!(sender, AppMsg::Increment); }, }, append = &gtk::Button { set_label: "Decrement", connect_clicked(sender) => move |_| { send!(sender, AppMsg::Decrement); }, }, append = &gtk::Label { set_margin_all: 5, set_label: watch! { &format!("Counter: {}", model.counter) }, } }, } }
} The first line doesn't change. We still have to define what's the model and what's the parent model. The only difference is that the struct AppWidgets is never explicitly defined in the code but generated by the macro. And then... wait, where do we define the Root type? Actually, the macro knows that your outermost widget is going to be the root widget. Next up - the heart of the widget macro - the nested view! macro. Here we can easily define widgets and assign properties to them. As you see we start with the gtk::ApplicationWindow which is our root. Then we open up brackets and assign properties to the window. There's not much magic here but actually set_title is a method provided by gtk4-rs. So technically the macro creates code like this: window.set_title(Some("Simple app")); Eventually, we assign a new widget to the window with set_child = Some(&gtk::Box) { The only difference to assigning properties is that we use = instead of :. We could also name widgets using the method: name = WIDGET syntax: set_child: vbox = Some(&gtk::Box) { To connect events we use the syntax method_name(cloned_elems, ...) => move |args, ...| { code... } Again there's no magic, the macro will simply assign a closure to a method. Because closures often need to capture local variables we need to clone them. Therefore we can list the variables we want to clone in the parentheses after the method name. connect_clicked(sender) => move |_| { send!(sender, AppMsg::Increment); }, The last special syntax of the widgets macro we'll cover here is the watch! macro. It's just like the normal initialization except that it also updates the property in the view function. So without it, the counter label would never be updated. set_label: watch! { &format!("Counter: {}", model.counter) },

